import React from 'react';
import logo from './logo.svg';
import './App.css';

// const schoolinfo = require('CollegeBasketballTeams.json'); //with path
import * as schoolInfo from '../src/CollegeBasketballTeams.json';

function Welcome() {
  return (<h1>Welcome! This page lists out schools, mascots, and locations</h1>)
}


class School extends React.Component 
<{name: string; school: string; city: string; state: string}>
{
  render() {
    const oneSchool = this.props;
    return (
      <div>
        <h2>Name: {oneSchool.school}</h2>
        <h3>Mascot: {oneSchool.name}</h3>
        <h3>City: {oneSchool.city}</h3> 
        <h3>{oneSchool.state}</h3>
      </div>
    )
  }
}

function SchoolList(){
  return(
    <div>
      {SchoolList.map(oneSchool => <Schools {...schoolInfo}/>)}

      <School {...schoolInfo.teams[0]}/>
      <Schools {...schoolInfo.teams[1]}/>
      <Schools {...schoolInfo.teams[2]}/>
      <Schools {...schoolInfo.teams[3]}/>
    </div>
  )
}

function App(){
  return (
    <div>
      <Welcome/>
      <SchoolList/>
    </div>
  )
}

export default App;
